import React from "react";


const Bank = (bankik, setBank, setMessages, valutate, summa, Sendtoback) => {
    setBank(bankik);
    setMessages(prev => [
        ...prev,
        {sender: 'user', text: bankik},
        {
            sender: 'bot',
            text:
                `Давайте полностью проверим информацию:\n` +
                `Валюта: ${valutate}\n` +
                `Сумма: ${summa}\n` +
                `Банк: ${bankik}`,
        },
        {
            sender: 'bot2',
            component: (
                <button className="button" onClick={Sendtoback}>
                    Все верно
                </button>
            ),
        },
    ]);
};
